svg.script:




var svgDoc;
var mic;
var bo1;
var bo2;
var bo3;
var backgroud;

var timerFunction = null;




function startup(evt){
  svgDoc=evt.target.ownerDocument;

    mic = svgDoc.getElementById("mic"); //get the inner element by id
    bo1 = svgDoc.getElementById("bo1"); 
    bo2 = svgDoc.getElementById("bo2"); 
    bo3 = svgDoc.getElementById("bo3"); 
    no = svgDoc.getElementById("no");
    backgroud = svgDoc.getElementById("backgroud");


    off();

    mic.addEventListener("mouseover",function(){

        on();



    },false); 

    mic.addEventListener("mouseout",function(){
        stopAnimation();
        off();


    },false); 


    mic.addEventListener("mouseup",function(){
        stopAnimation();
        disconnect();


    },false); 
};

function on()
{
        startOnAnimation();
        mic.style.opacity=1;


};

function off()
{


    mic.style.opacity=0.5;
    bo1.style.visibility="hidden";
    bo2.style.visibility="hidden";
    bo3.style.visibility="hidden";
    no.style.visibility="hidden"; 







};

function disconnect()
{
    off();
    no.style.visibility="visible";
    startDisconAnimation();

};


function see(n){

  e=svgDoc.getElementById("bo"+n);
  ega=e.style.visibility;
  if (ega=="hidden") e.style.visibility="visible";
  else e.style.visibility="hidden";
};



    function startOnAnimation() {
        if(timerFunction == null) {
            timerFunction = setInterval(onanimate, 200);
        }


    };


    function startDisconAnimation() {
        if(timerFunction == null) {
            timerFunction = setInterval(disconAnimation, 500);
        }


    };

    function stopAnimation() {
        if(timerFunction != null){
            clearInterval(timerFunction);
            timerFunction = null;
        }


    } ; 


var k=1;

function onanimate() {
    if(k>3)
    {
        k=1;
    }
    see(k++);







};  

var no_display=true;
function disconAnimation()
{
    if(no_display)
    {
        no.style.visibility="hidden";
        no_display=false;
    }
    else
    {
        no.style.visibility="visible";
        no_display=true;
    }



};
